import { moduleFor, test } from 'ember-qunit';
import Ember from 'ember';

const {
  run,
} = Ember;

moduleFor('service:rasterizer', 'Unit | Service | rasterizer', {
});

//
// rasterize()
//

test('it rasterizes SVG', function(assert) {
  assert.expect(1);

  const service = this.subject();
  const sourceElement = document.getElementById('sample-svg-element');
  const expected = `data:image/png;base64,`;
  const done = assert.async();

  run(() => {
   service.rasterize('svg', sourceElement)
     .then((result) => {
       assert.equal(
         result,
         expected,
         'encoded image should be correct'
       );
       done();
     });
  });
});

