test('it rasterizes HTML', function(assert) {
  assert.expect(1);

  const service = this.subject();
  const sourceElement = document.getElementById('sample-html-element');
  const expected = `data:image/png;base64,`;
  const done = assert.async();

  run(() => {
   service.rasterize('html', sourceElement)
     .then((result) => {
       assert.equal(
         result,
         expected,
         'encoded image should be correct'
       );
       done();
     });
  });
});

test('it throws an error if not HTML or SVG', function(assert) {
  assert.expect(1);

  const service = this.subject();

  assert.throws(() => {
    service.rasterize('RANDO', 'source');
  }, new Error('Assertion Failed: HTML and SVG are supported'), 'Expect an error with this message');
});

//
// _cloneSource()
//

test('_cloneSource creates a clone with inlined styles', function(assert) {
  assert.expect(1);

  const sourceElement = document.getElementById('sample-html-element');
  const service = this.subject({
    fontSize: [],
    copyStyles() {
      assert.ok(true, 'copyStyles is called twice');
    },
    generateNodeTree() {
      assert.ok(true, 'generateNodeTree is called twice');
    },
  });
  const result = service._cloneSource(sourceElement);
  const expected = '<divid=\"sample-html-element\"style=\"animation:none0sease0s1normalnonerunning;background:rgba(0,0,0,0)nonerepeatscroll0%0%/autopadding-boxborder-box;border:0pxnonergb(255,0,0);bottom:auto;clear:none;clip:auto;color:rgb(255,0,0);columns:autoauto;contain:none;cursor:auto;cx:0px;cy:0px;d:none;direction:ltr;display:block;fill:rgb(0,0,0);filter:none;flex:01auto;float:none;font:normalnormalnormalnormalNaNpx/normalTimes;height:18px;isolation:auto;left:auto;margin:0px;mask:none;motion:none0pxauto0deg;opacity:1;order:0;orphans:2;outline:rgb(255,0,0)none0px;overflow:visible;padding:0px;perspective:none;position:static;r:0px;resize:none;right:auto;rx:auto;ry:auto;speak:normal;stroke:none;top:auto;transform:none;transition:all0sease0s;visibility:visible;widows:2;width:1249px;x:0px;y:0px;zoom:1;\">SHOWME</div>';

  const wrapper = document.createElement("div");
  wrapper.appendChild(result);
  const resultString = wrapper.innerHTML.replace(/\s/g,'');

  assert.equal(
    resultString,
    expected,
    'clone is generated correctly'
  );
});

//
// splitRawFontSize()
//

test('_splitRawFontSize accepts valid CSS units', function(assert) {
  assert.expect(10);

  const service = this.subject();
  const size = '12.2';
  [
    'cm',
    'em',
    'ex',
    'in',
    'mm',
    'pc',
    'pt',
    'px',
    'rem',
  ].forEach((units) => {
    let result = service._splitRawFontSize(`${size}${units}`);
    const expectedResult = {
      size,
      units,
    };
    assert.deepEqual(
      result,
      expectedResult,
      'result should contain size and units'
    );
  });

  assert.throws(() => {
    service._splitRawFontSize(`${size}one-bad-unit`);
  }, new Error('Assertion Failed: Must pass a valid size'), 'Expect an error with this message');
});

test('_splitRawFontSize accepts integers', function(assert) {
  assert.expect(1);

  const service = this.subject();
  const size = 124;
  const result = service._splitRawFontSize(size);
  const expectedResult = {
    size: '124',
    units: undefined,
  };
  assert.deepEqual(
    result,
    expectedResult,
    'result should contain size as string'
  );
});

test('_splitRawFontSize accepts floats', function(assert) {
  assert.expect(1);

  const service = this.subject();
  const size = 12.4;
  const result = service._splitRawFontSize(size);
  const expectedResult = {
    size: '12.4',
    units: undefined,
  };
  assert.deepEqual(
    result,
    expectedResult,
    'result should contain size as string'
  );
});
